import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-projects',
  templateUrl: './projects.component.html',
  styleUrls: ['./projects.component.css']
})
export class ProjectsComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<h1>Projects</h1>
<br>
<br>
<div class="d-flex align-items-center justify-content-center flex-column">
  <h3 class="fifty-hundred m-2">
    Currently working as a full-time software engineer at <a href="https://chipsoft.com/nl-NL/" target="_blank">ChipSoft</a>.
  </h3>
  <br>
  <br>
  <h3 class="fifty-hundred m-2">
    You can see all my open source projects on my <a href="https://github.com/CubedCard" target="_blank">github</a> page.
  </h3>
</div>
